import React from "react";
import "./MainMenu.css";

const MainMenu: React.FC = () => {
    return (
    <body className="Menu">
        <header>
            <nav></nav>
        </header>
        <aside>
            <nav></nav>
        </aside>
        <main></main>
        <footer>
            pivo
            <nav></nav>
        </footer>
    </body>
);
};

export default MainMenu;
